import React, { useState } from "react";

function Corporation() {
  const [name, setName] = useState("");
  return (
    <section>
      <div className="information">
        <label>Corporation: </label>
        <input
          type="text"
          onChange={(event) => {
            setName(event.target.value);
          }}
        />
      </div>
    </section>
  );
}

export default Corporation;
